import React, { PureComponent } from "react";
import Head from "next/head";
import { RadialBar } from "@ant-design/plots";

// import AppLayout from "../components/AppLayout";
const data = [
  { name: "쉐도우", star: 297 },
  { name: "스파링", star: 506 },
  { name: "줄넘기", star: 805 },
  { name: "턱걸이", star: 1478 },
  { name: "팔굽혀펴기", star: 2029 },
  { name: "G6", star: 7100 },
  { name: "F2", star: 7346 },
  { name: "G2", star: 10178 },
];

const Profile = () => {
  const config = {
    data,
    xField: "name",
    yField: "star",
    maxAngle: 90,
    radius: 1,
    innerRadius: 0.2,
    style: {
      radius: 26,
    },
    scale: {
      y: { nice: true },
    },
  };

  return (
    <AppLayout>
      <Head>
        <title>NTB</title>
      </Head>
      <div>운동</div>
      <RadialBar {...config} />
    </AppLayout>
  );
};

export default Profile;
